import React from "react";

class Header extends React.Component {
    render() {
        return (
            <Header>
                <h1>Catch 
                    span.of The Day </h1>
            <h3 className="tagline">
                <span>Fresh Daily</span>
            </h3>
            </Header>
        )
    }
}

export default Header;
